$1-$2-$3:
Date format. E.g. for the 3 May 2001 in Common Era:
* "%3/%2/%1" (for d/m/Y) gives "3/5/2001";
* "%2/%3/%1" (for m/d/Y) gives "5/3/2001";
* "%1.%2.%3" (for Y.m.d) gives "2001.5.3".
